import React, {useState , useEffect} from 'react'

function Home() {

    const [homeData, setHomeData] = useState();

    
  useEffect(() => {
     
    fetch(
      'https://www.themealdb.com/api/json/v1/1/filter.php?a=Indian'
    )
      .then((response) => response.json())
      .then((data) => {
        setHomeData(data.meals)
      
      })
      .catch(() => {
        console.log("error");
      })},[])
  return (
    <div>{homeData}</div>
  )
}

export default Home
